import React from "react";
import { Col, Row } from "react-bootstrap";
import "./watchScreen.scss";

const watchScreen = () => {
  return (
    <Row>
      <Col lg={8}></Col>

      <div className="watchScreen_player">
        <iframe
          src="https://www.youtube.com/embed/tgbNymZ7vqY"
          frameborder="0"
        ></iframe>
      </div>

      <Col lg={4}></Col>
    </Row>
  );
};

export default watchScreen;
